export interface MinimalTokenClaims {
    jti?: string;
    iss: string;
    aud: string;
    sub: string;
    exp: number;
    nbf?: number;
}
/**
 * Decode the body of the token and return the claims, without checking authenticity of claims.
 */
export declare const getUnauthedClaims: <C extends MinimalTokenClaims>({ token, }: {
    token: string;
}) => C;
